import { useState } from 'react'
import { ArrowLeft, CreditCard, DollarSign } from "lucide-react"
import jsPDF from 'jspdf'

export default function Component() {
  const [donationAmount, setDonationAmount] = useState('')
  const [formData, setFormData] = useState({
    email: '',
    card: '',
    name: '',
    country: 'es',
    postalCode: ''
  })
  const [orderNumber, setOrderNumber] = useState(1) // Número de orden secuencial
  const [error, setError] = useState('') // Variable de error
  
  // Handle the donation amount input change
  const handleDonationChange = (e) => {
    const value = e.target.value.replace(/[^0-9.]/g, '')
    setDonationAmount(value)
  }

  // Handle form input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }))
  }

  // Formatear la fecha de vencimiento de la tarjeta con '/' en el medio
  const formatCardDate = (value) => {
    const formatted = value.replace(/\D/g, '').slice(0, 4);
    if (formatted.length >= 3) {
      return `${formatted.slice(0, 2)}/${formatted.slice(2)}`;
    }
    return formatted;
  }

  // Formatear el número de tarjeta para separarlo en bloques de 4 dígitos
  const formatCardNumber = (value) => {
    return value.replace(/\D/g, '').replace(/(.{4})/g, '$1 ').trim();
  }

  const handleCardChange = (e) => {
    const { name, value } = e.target;
    if (name === "card") {
      setFormData(prevState => ({
        ...prevState,
        card: formatCardNumber(value) // Formatear el número de la tarjeta
      }));
    } else if (name === "cardExpiry") {
      setFormData(prevState => ({
        ...prevState,
        cardExpiry: formatCardDate(value) // Formatear la fecha de vencimiento
      }));
    }
  }

  // Function to generate PDF
  const generarFacturaPDF = () => {
    const { email, card, name, country, postalCode } = formData
    const subtotal = Number(donationAmount)
    const iva = subtotal * 0.16 // IVA del 16%
    const total = subtotal + iva

    if (!donationAmount || !email || !card || !name || !postalCode) {
      setError('Por favor complete todos los campos.')
      return
    }
    setError('') // Clear error if form is valid

    const doc = new jsPDF()

    // Agregar imagen (por ejemplo, logo)
    const logoUrl = 'data:image/png;base64,'; // Reemplaza con la imagen en formato base64' // Reemplaza con la URL de tu imagen
    doc.addImage(logoUrl, 'PNG', 10, 10, 30, 30) // Asegúrate de ajustar la posición y el tamaño

    // Título y encabezado
    doc.setFont('helvetica', 'bold')
    doc.setFontSize(18)
    doc.text('Comprobante de Donación', 60, 30)

    doc.setFontSize(12)
    doc.setFont('helvetica', 'normal')
    doc.text(`Número de orden: #${orderNumber}`, 20, 50)
    doc.text(`Fecha: ${new Date().toLocaleDateString('es-MX')}`, 20, 56)

    // Línea de separación
    doc.line(20, 60, 190, 60)

    // Información del cliente
    doc.setFontSize(14)
    doc.setFont('helvetica', 'bold')
    doc.text('Cliente', 20, 70)
    doc.text('Nosotros', 130, 70)

    doc.setFontSize(12)
    doc.setFont('helvetica', 'normal')
    doc.text(`${name}`, 20, 78)
    doc.text(`${email}`, 20, 84)

    // Información de la organización
    doc.text('SOLVIA ONG', 130, 78)
    doc.text('Manzanillo, Col. El naranjo', 130, 84)
    doc.text('solviacorp@gmail.com', 130, 90)

    // Línea de separación para la tabla
    doc.line(20, 100, 190, 100)

    // Tabla de descripción, cantidad y precio
    doc.setFontSize(12)
    doc.setFont('helvetica', 'bold')
    doc.text('Descripción', 25, 108)
    doc.text('Cantidad', 100, 108)
    doc.text('Precio', 160, 108)

    // Valores de la tabla
    doc.setFont('helvetica', 'normal')
    doc.text('Donación a SOLVIA', 25, 116)
    doc.text('1', 110, 116)
    doc.text(`${Number(donationAmount).toLocaleString('es-MX', { style: 'currency', currency: 'MXN' })}`, 160, 116)

    // Línea de separación debajo de la tabla
    doc.line(20, 122, 190, 122)

    // Totales: Subtotal, IVA y Total
    doc.setFontSize(12)
    doc.text(`Subtotal: ${subtotal.toLocaleString('es-MX', { style: 'currency', currency: 'MXN' })}`, 140, 130)
    doc.text(`IVA (16%): ${iva.toLocaleString('es-MX', { style: 'currency', currency: 'MXN' })}`, 140, 136)
    doc.setFont('helvetica', 'bold')
    doc.text(`Total: ${total.toLocaleString('es-MX', { style: 'currency', currency: 'MXN' })}`, 140, 142)

    // Firma simulada
    doc.setFont('helvetica', 'bold')
    doc.text('SOLVIA ONG', 20, 160)
    doc.setDrawColor(0)
    doc.setLineWidth(0.5)
    doc.line(20, 165, 80, 165)
    doc.setFont('helvetica', 'italic')
    doc.text('Firma de SOLVIA', 20, 175)

    // Mensaje de agradecimiento
    doc.setFontSize(16)
    doc.setTextColor(255, 165, 0)
    doc.text('¡Gracias!', 140, 180)

    // Términos y condiciones
    doc.setFont('helvetica', 'bold')
    doc.setFontSize(10)
    doc.text('TÉRMINOS Y CONDICIONES DE LA DONACIÓN:', 105, 200, { align: 'center' })
    doc.setFont('helvetica', 'normal')
    doc.text('• La donación es final y no es reembolsable bajo ninguna circunstancia.', 105, 208, { align: 'center' })
    doc.text('• Los fondos recaudados serán destinados exclusivamente a programas sociales.', 105, 214, { align: 'center' })
    doc.text('• Los donantes podrán solicitar un comprobante fiscal de su donación.', 105, 220, { align: 'center' })
    doc.text('• SOLVIA se compromete a usar las donaciones de manera transparente.', 105, 226, { align: 'center' })

    // Guardar el documento
    doc.save('Comprobante_Donacion.pdf')

    // Incrementar el número de orden para la próxima donación
    setOrderNumber(prevOrderNumber => prevOrderNumber + 1)

    // Limpiar los campos del formulario y la cantidad de la donación
    setFormData({
      email: '',
      card: '',
      name: '',
      country: 'es',
      postalCode: ''
    })
    setDonationAmount('')
  }

  const handleSubmit = (e) => {
    e.preventDefault()
    generarFacturaPDF()
  }

  return (
    <div className="min-h-screen bg-gray-900 flex items-center justify-center text-white">
      <div className="w-full max-w-[1000px] bg-gray-800 rounded-xl shadow-lg overflow-hidden">
        <div className="flex flex-col md:flex-row">
          {/* Left Column */}
          <div className="md:w-1/2 p-8 bg-gray-700">
            <div className="mb-8">
              <div className="flex items-center gap-4">
                <button className="text-gray-400 hover:text-gray-300">
                  <ArrowLeft className="h-6 w-6" />
                </button>
                <div className="flex items-center gap-2">
                  <div className="h-8 w-8 rounded-full bg-primary flex items-center justify-center">
                    <CreditCard className="h-4 w-4 text-primary-foreground" />
                  </div>
                  <span className="font-medium text-gray-300">SOLVIA</span>
                  <span className="rounded bg-yellow-100 px-2 py-0.5 text-xs font-medium text-yellow-800">
                    DONACION
                  </span>
                </div>
              </div>
            </div>
            
            <h1 className="text-xl font-semibold text-gray-300 mb-6">Donar a SOLVIA para fondeo de programas</h1>
            <div className="text-3xl font-bold mb-8">
              ${donationAmount ? parseFloat(donationAmount).toFixed(2) : '0.00'}
            </div>
            
            <div className="bg-gray-600 p-6 rounded-lg shadow-md">
              <div className="flex items-center gap-4">
                <div className="h-16 w-16 bg-primary/10 rounded-lg flex items-center justify-center">
                  <DollarSign className="h-8 w-8 text-primary" />
                </div>
                <div className="flex-1">
                  <h3 className="font-medium">Tu donación</h3>
                  <div className="text-sm text-gray-400">Ayuda a nuestra causa</div>
                </div>
                <div className="font-medium">${donationAmount ? parseFloat(donationAmount).toFixed(2) : '0.00'}</div>
              </div>
            </div>
          </div>
          
          {/* Right Column */}
          <div className="md:w-1/2 p-8">
            <h2 className="text-2xl font-semibold mb-6">Pagar con tarjeta</h2>
            {error && <div className="text-red-500 text-sm mb-4">{error}</div>}
            <form onSubmit={handleSubmit} className="space-y-6">
              <div className="space-y-2">
                <label htmlFor="donation" className="block text-sm font-medium text-gray-300">Cantidad a donar</label>
                <input 
                  id="donation" 
                  type="text" 
                  placeholder="0.00" 
                  value={donationAmount}
                  onChange={handleDonationChange}
                  className="w-full px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                />
              </div>

              <div className="space-y-2">
                <label htmlFor="email" className="block text-sm font-medium text-gray-300">Email</label>
                <input 
                  id="email" 
                  name="email"
                  type="email" 
                  placeholder="tu@ejemplo.com" 
                  value={formData.email}
                  onChange={handleInputChange}
                  className="w-full px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                />
              </div>
              

              <div className="space-y-2">
                <label htmlFor="card" className="block text-sm font-medium text-gray-300">Información de la tarjeta</label>
                <input 
                  id="card" 
                  name="card"
                  placeholder="1234 1234 1234 1234" 
                  value={formData.card}
                  onChange={handleCardChange}
                  className="w-full px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                />
                <div className="grid grid-cols-2 gap-4">
                  <input 
                    placeholder="MM / AA" 
                    name="cardExpiry"
                    value={formData.cardExpiry || ''}
                    onChange={handleCardChange}
                    className="px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                  />
                  <input 
                    placeholder="CVC" 
                    className="px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                  />
                </div>
              </div>
              
              <div className="space-y-2">
                <label htmlFor="name" className="block text-sm font-medium text-gray-300">Nombre del titular</label>
                <input 
                  id="name" 
                  name="name"
                  placeholder="Nombre completo en la tarjeta" 
                  value={formData.name}
                  onChange={handleInputChange}
                  className="w-full px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                />
              </div>
              
              <div className="space-y-2">
                <label className="block text-sm font-medium text-gray-300">País o región</label>
                <select 
                  className="w-full px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                  name="country"
                  value={formData.country}
                  onChange={handleInputChange}
                >
                  <option value="es">España</option>
                  <option value="mx">México</option>
                  <option value="ar">Argentina</option>
                  <option value="co">Colombia</option>
                </select>
                <input 
                  placeholder="Código postal" 
                  value={formData.postalCode}
                  name="postalCode"
                  onChange={handleInputChange}
                  className="w-full px-4 py-2 border border-gray-600 bg-gray-700 text-white rounded-md shadow-sm focus:ring-2 focus:ring-primary focus:outline-none"
                />
              </div>
              
              <button 
                type="submit" 
                className="w-full px-4 py-2 bg-primary text-white rounded-md shadow-sm hover:bg-primary-dark focus:ring-2 focus:ring-primary focus:outline-none"
              >
                Donar ${donationAmount ? parseFloat(donationAmount).toFixed(2) : '0.00'}
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  )
}
